import { getTimeDate } from "@/utils/index.js";

import Qs from "qs";
// 1，未完善资料，2、已提交资料，待平台审核，3、审核中，4、审核通过，5、审核失败，6、正常，7、锁定，8，黑名单
export default {
  filters: {
    statusFilter(status) {
      const statusMap = {
        1: "info",
        2: "primary",
        3: "success",
        4: "danger"
      };
      return statusMap[status];
    }
  },
  data() {
    return {
      fileurl: "",
      list: null,
      multipleSelection: [],
      listLoading: true,
      exporting: false,
      form: {
        status: "",
        userId: "",
        starttime: "",
        endtime: "",
        _uiName_: "eleme",
        _pagination: "{'pageNumber':1,'pageSize':10}"
      }
    };
  },
  created() {},
  computed: {},
  mounted() {
    this.fetchData();
  },
  methods: {
    formatTime(row, column, cellValue) {
      return getTimeDate(cellValue);
    },
    getStatusname(statusid) {
      const statusMap = {
        1: "待转账",
        2: "转账中",
        3: "转账成功",
        4: "转账失败"
      };
      return statusMap[statusid];
    },

    resetForm(formName) {
      this.$refs[formName].resetFields();
    },

    //获取充值申请列表
    fetchData() {
      this.listLoading = true;
      this.axios
        .get(this.urls.cashoutlist + "?" + Qs.stringify(this.form))
        .then(response => {
          this.list = response.data.list;
          this.listLoading = false;
        });
    },

    operationHandle(index, row, type) {
      // let ids = "";
      // this.multipleSelection.forEach(row => {
      //   ids = ids + row.id + ",";
      // });
      let param = {
        ids: row.id
      };
      switch (type) {
        case 1:
          this.operationRemote(this.urls.cashoutsuccess, param); // 提现成功
          break;
        case 0:
          this.operationRemote(this.urls.cashoutfail, param); // 提现失败
          break;

        default:
          break;
      }
    },
    operationRemote(url, param) {
      this.$confirm("是否确认操作?", "提示", {
        confirmButtonText: "确定",
        cancelButtonText: "取消",
        type: "warning"
      }).then(() => {
        this.axios.post(url + "?" + Qs.stringify(param)).then(response => {
          this.fetchData();
        });
      });
    },
    toggleSelection(rows) {
      if (rows) {
        rows.forEach(row => {
          this.$refs.multipleTable.toggleRowSelection(row);
        });
      } else {
        this.$refs.multipleTable.clearSelection();
      }
    },
    handleSelectionChange(val) {
      this.multipleSelection = val;
    },
    lookinfo() {},
    exportTxt() {
      if (this.multipleSelection.length == 0)
        return this.$message.error("请选择需要导出的数据");

      this.exporting = true;
      let ids = "";
      this.multipleSelection.forEach(row => {
        ids = ids + row.id + ",";
      });
      this.axios
        .post(this.urls.cashoutexport + "?" + Qs.stringify({ ids: ids }))
        .then(response => {
          this.fetchData();

          this.fileurl =
            this.urls.imgbaseurl +
            response.data.substring(2, response.data.length);

          this.exporting = false;

          this.axios.get(this.fileurl).then(response => {
            let blob = new Blob([response.data], {
              type: "application/txt"
            });

            let fileName =
              "红柿子提现申请表" +
              "-" +
              getTimeDate(Date.parse(new Date())) +
              ".txt";
            if (window.navigator.msSaveOrOpenBlob) {
              navigator.msSaveBlob(blob, fileName);
            } else {
              var link = document.createElement("a");
              link.href = window.URL.createObjectURL(blob);
              link.download = fileName;
              link.click();
              window.URL.revokeObjectURL(link.href);
            }
          });
        });
    }
  }
};
